　前モデルから３L容量を拡大し収納力を向上したバックパック。アウトポケット内側は保冷用のパーツ内蔵。<br>■カラー：001、101<br>■サイズ：F（50cm×36cm×20cm(36L)）<br>■素材：ポリウレタン76％、ポリエステル24％<br><br><br>検索ワード：バック かばん 鞄 旅行 修学旅行 カジュアルバッグ リュックサック リュック  デイバッグ バッグ 通勤 通学<style TYPE="text/css">

