　悪天候の中でも快適な撥水加工を施したモデル｡<br>ラップトップ用収納スペース付き。<br>ボトルポケット付き。<br>サイドに小物ポケット付き。<br>■カラー：BLK、GPH<br>■サイズ：W33cm×H48cm×D25cm（33L）<br>■素材：ポリエステル、ナイロン<br>■原産国：中国<br>※製品によって仕上りサイズに多少の誤差がありますのでご了承下さいませ。<br><br><br>検索ワード：バック かばん 鞄 旅行 修学旅行 カジュアルバッグ リュックサック リュック  デイバッグ バッグ 通勤 通学<style TYPE="text/css">

