　バックの大きなロゴが特徴のバックパックです。バックの形に沿ってオープンできる2wayジップの大容量バックです。サイドはボトルを入れることができるメッシュポケット付き。背面とショルダーはエアメッシュパッドなので、通気性、快適性は抜群です。ショルダーにはストラップがついているので腰をカバーします。様々なシーンで使えるバックです。<br>■カラー：01、19、02<br>■サイズ：マチ/21センチ、持ち手/46～83cm、高さ/46cm、幅/30cm<br>■重さ：(約)720g<br>■素材：合成皮革、ポリエステル <br><br><br>検索ワード：バック かばん 鞄 旅行 修学旅行 カジュアルバッグ リュックサック リュック  デイバッグ バッグ 通勤 通学<style TYPE="text/css">

