　2つのコンパートメントからなる高機能バックパック。<br>メインコンパートメントは2wayジップ開口、パッド緩衝材を使ったPCコンパートメント。<br>フロントコンパートメントには携帯電話は小物を収納できるポケット。<br>パッド付きショルダーと背面仕様で着用時の負担軽減と通気をサポート。<br>ベース部分には摩耗に強いDura Base(デュラベース)素材を使用。<br>再帰反射テープやキャットプリントのディテイルと細部までこだわった高機能バックパック。<br>■カラー：01、02、03、04<br>■素材：ポリエステル<br>■サイズ：Ｗ27.5・Ｈ48・Ｄ12.5<br>■重量：480ｇ<br><br><br>検索ワード：バック かばん 鞄 旅行 修学旅行 カジュアルバッグ リュックサック リュック  デイバッグ バッグ 通勤 通学<style TYPE="text/css">

